create table Patients (
	Patient_ID INT,
	First_Name VARCHAR(50),
	Last_Name VARCHAR(50),
	Date_of_Birth DATE,
	Gender VARCHAR(50),
	Contact_Number VARCHAR(50),
	Address VARCHAR(50),
	Emergency_Contact VARCHAR(50),
	Medical_History VARCHAR(50)
);
